server:
  port: 8761

ead:
  serviceRegistry:
    username: '{cipher}'
    password: '{cipher}'

eureka:
  client:
    register-with-eureka: false
    fetch-registry: false
    service-url:
      defaultZone: 'http://${ead.serviceRegistry.username}:${ead.serviceRegistry.password}@localhost:8761/eureka'
